import React from 'react';
import './footer.scss'
import Logo from './logo_usd.jpg'
import TableFoot from "./table_foot";

const Footer = () => {
    return (
        <footer>
            <div className="first_foot">
                <img src={Logo}/>
                <div className="social">
                    <div className="text_social">Подпишитесь в соц. сетях</div>
                    <div className="icons">
                        <div className="first_icon"></div>
                        <div className="second_icon"></div>
                    </div>
                </div>
            </div>
            <div className="second_foot">
                <TableFoot title="Главная" name_text={[
                    {"name":"Benefits", "link":"#"},
                    {"name":"Our Testimonials", "link":"#"},
                    {"name":"Partners", "link":"#"}
                ]}/>
                <TableFoot title="Services" name_text={[
                    {"name":"Web Design", "link":"#"},
                    {"name":"Website Development", "link":"#"},
                    {"name":"App Development", "link":"#"},
                    {"name":"Digital Marketing", "link":"#"}
                ]}/>
                {/*<TableFoot title="Партнёры" name_text={["Alphard Group","Dynamic State","Aura","ACV","Kicx","SWAT","ORIS"]}/>*/}
                {/*<TableFoot title="About Us" name_text={["Our Team","Achievements","Awards"]}/>*/}
                {/*<TableFoot title="Careers" name_text={["Job Openings","Benefits & Perks","Employee Refral"]}/>*/}
                {/*<TableFoot title="Blogs" name_text={["Our Blogs"]}/>*/}
            </div>
            <div className="third_foot">
                <div className="first_text">@2024 USD-Russia. Все права защищены.</div>
                <div className="second_text">
                    <div className="third_foot_text">Privacy Policy</div>
                    <div className="third_foot_text">Terms & Conditions</div>
                    <div className="third_foot_text">Cookie Policy</div>
                </div>
            </div>
        </footer>
    );
};

export default Footer;
